import React from 'react'
import { PokemonCard } from './PokemonCard'
import './Cards.css'
export const AllCards = ({ results }) => {
    results.map(res => (console.log(res.url)))
    return (
        <div className='container-pokemon'>
            {results.map((element, index) => {
                if (index % 3 === 0) {
                    console.log("impresion desde all cards", results[index])
                    return (
                        <div className="row">
                            <div className="col"><PokemonCard url={results[index].url} /></div>
                            <div className="col"><PokemonCard url={results[index + 1].url} /></div>
                            <div className="col"><PokemonCard url={results[index + 2].url} /></div>
                        </div>
                    );
                }
            })
            }
        </div>
    )
}
